```cpp
class Solution {
public:
    int numDifferentIntegers(string word) {
        int n = word.length();
        unordered_set<string> s;
        int i = 0;
        while(i < n){
            if(!isdigit(word[i])){
                i++;
                continue;
            }
            string temp = "";
            while(i < n && isdigit(word[i])){
                temp += word[i];
                i++;
            }
            int j = 0;
            while(j < temp.length() && temp[j] == '0') j++;
            temp = temp.substr(j);
            s.insert(temp);
        }
        return s.size();
    }
};
```
In the function numDifferentIntegers, the while loop condition is incorrect. It should be i < n instead of i <= n. 

Also, the insertion of the digit into the temp string and the while loop condition to remove the leading zeros is incorrect. 

In the while loop condition, it should be word[i] and not word[i++]. 

And finally, the return statement should return the size of the set, not the size of the string.
